import React, { useEffect, useState } from "react";
import { useParams, Link } from "react-router-dom";
import { Container, Row, Col } from "react-bootstrap";
import HeaderTwo from "../../components/common/Header";
import { BreadcrumbBox } from "../../components/common/Breadcrumb";
import FooterTwo from "../../components/FooterTwo";
import { Styles } from "./styles/facilities-details";
import facilitiesData from "../../data/facilities/facilities-details.json";

const FacilitiesDetails = () => {
  const { id } = useParams(); // gets the URL param like facilities-1
  const [filteredFacilities, setFilteredFacilities] = useState([]);

  useEffect(() => {
    const result = facilitiesData.filter((facility) => facility.id === id);
    setFilteredFacilities(result);
  }, [id]);

  return (
    <Styles>
      <div className="main-wrapper blog-details-page">
        <HeaderTwo />
        <BreadcrumbBox title="Facility Details" />

        <section className="blog-details-area">
          <Container>
            <Row>
              <Col lg="11" md="8" sm="7">
                <div className="blog-details-box">
                  <div className="blog-details-banner">
                    <img
                      src={`${process.env.PUBLIC_URL}/assets/images/blog_c-04.jpg`}
                      alt=""
                      className="img-fluid"
                    />
                  </div>

                  <div className="heading">
                    <h4>Description</h4>
                  </div>
                  <div className="blog-details-desc">
                    <p>
                      Facilities tailored to enhance learning experience with
                      modern infrastructure.
                    </p>
                    <ul className="list-unstyled">
                      <li>
                        <i className="fa fa-check"></i> Well-equipped facilities.
                      </li>
                      <li>
                        <i className="fa fa-check"></i> Experienced staff.
                      </li>
                      <li>
                        <i className="fa fa-check"></i> Safety-focused infrastructure.
                      </li>
                    </ul>
                  </div>

                  {/* Dynamic Facility List */}
                  <div className="blog-details-other-labs">
                    <Row>
                      {filteredFacilities.map((data, i) => (
                        <Col md="12" key={i}>
                          <div className="course-item d-flex">
                            <div className="course-image-box">
                              <div
                                className="course-image"
                                style={{
                                  backgroundImage: `url(${process.env.PUBLIC_URL}/assets/images/${data.imgUrl})`,
                                  height: "150px",
                                  width: "290px",
                                  backgroundSize: "cover",
                                  backgroundPosition: "center",
                                }}
                              ></div>
                            </div>
                            <div className="course-content">
                              <h6 className="heading">
                                <Link to={data.courseLink}>
                                  {data.courseTitle}
                                </Link>
                              </h6>
                              <p className="desc">{data.courseDesc}</p>
                            </div>
                          </div>
                        </Col>
                      ))}
                    </Row>
                  </div>
                </div>
              </Col>
            </Row>
          </Container>
        </section>
        <FooterTwo />
      </div>
    </Styles>
  );
};

export default FacilitiesDetails;
